 def analyzeSentence(sentence):
    # split the sentence into words and lowercase them
    words = [w.lower() for w in sentence.split()]

    # initialize a dictionary to store the counts of each option
    option_counts = {'a': 0, 'b': 0, 'c': 0, 'd': 0}

    # loop through the words and check if they match any option
    for word in words:
        if word == 'alexander':
            option_counts['a'] += 1
        elif word == 'abigail':
            option_counts['b'] += 1
        elif word == 'costs' or word == 'commitment' or word == 'knowledge' or word == 'attitude' or word == 'norms':
            option_counts['c'] += 1
        elif word == 'vulnerability' or word == 'costs' or word == 'belief':
            option_counts['d'] += 1

    # return the option with the highest count
    return max(option_counts, key=option_counts.get)

